const BoxMain = ({ currentWeather }) => {
    //const weather = currentWeather;
    return (
        <div style={boxLeftStyle}>
            <>
                currentWeather.name ? <p>{currentWeather.name} </p> : <p>Loading</p>
                currentWeather.main.temp ? <p>{currentWeather.main.temp}°C</p> : <p>Loading</p>
                currentWeather.weather.description ? <p>{currentWeather.weather.description}°C</p> : <p>Loading</p>
            </>
        </div >
    )
    //return (<div style={boxLeftStyle}></div>);
}

const boxLeftStyle = {
    margin: 0,
    padding: 0,
    width: '100%',
    height: '44%',
    background: 'rgba(255, 255, 255, 0.8)',
    borderRadius: '25px',
    boxShadow: '5px 5px 10px 5px rgba(0,0,0,0.1)',
    display: 'flex',
    flexDirection: 'row',
}

export default BoxMain;
